    <br>
    <div>
        <form>
            <label for="nameInput">Name</label>
            <input type="text" id="nameInput">
            <label for="abilityInput">Ability</label>
            <input type="number" id="abilityInput" min="0" max="100">
            <label for="pieceIconInput">Icons:</label>
            <select name="pieceIconInput" id="pieceIconInput" onchange="changePieceIcon()">
                <option value="assassinIcon">Assassin</option>
                <option value="bowmanIcon">Bowman</option>
                <option value="championIcon">Champion</option>
                <option value="dragoonIcon">Dragoon</option>
                <option value="duchessIcon">Duchess</option>
                <option value="dukeIcon">Duke</option>
                <option value="flagIcon">Flag</option>
                <option value="footmanIcon">Footman</option>
                <option value="generalIcon">General</option>
                <option value="knightIcon">Knight</option>
                <option value="longbowmanIcon">Longbowman</option>
                <option value="marshallIcon">Marshall</option>
                <option value="mountainIcon">Mountain</option>
                <option value="oracleIcon">Oracle</option>
                <option value="oracleNonStartIcon">Oracle - Non Start</option>
                <option value="pikemanIcon">Pikeman</option>
                <option value="priestIcon">Priest</option>
                <option value="rangerIcon">Ranger</option>
                <option value="seerIcon">Seer</option>
                <option value="wizardIcon">Wizard</option>
            </select>
            <label for="oppositeIconSideInput">Allow opposite side icons:</label>
            <input type="checkbox" id="oppositeIconSideInput">
            <label for="amountInput">Amount of pieces in set</label>
            <input type="number" id="amountInput" min="0" value="1">
        </form>
        <br>
        <form>
            <input type="button" id="switchSidesInput" value="Switch Sides" onclick="switchSides()">
            <input type="button" id="newPieceInput" value="Create New Piece" onclick="createNewPiece()">
            <input type="button" id="previousPieceInput" value="◄ Previous New Piece" onclick="backwardPiece()">
            <input type="button" id="nextPieceInput" value="Next Piece ►" onclick="forwardPiece()">
            <!-- <input type="button" id="deletePieceInpit" value = "Delete Piece" onclick="deletePiece()"> -->
            <input type="button" id="exportPiececsInput" value="Export" onclick="exportPieces()">
        </form>
        <br>
        <form>
            <label for="importPiececsInput">Import:</label>
            <input type="file" id="importPiececsInput" onchange="importPieces(this)">
        </form>
    </div>
